import { useState } from "react"
import { BrowserRouter, Routes, Route, useNavigate, useParams, Link} from "react-router-dom"

export default function ToDoApp()
{
    return(
        <div className="ToDoApp">
            <HeaderComponent/>
            <BrowserRouter>
                <Routes>
                <Route path="/" element={<LogIn/>}></Route>
                    <Route path="/login" element={<LogIn/>}></Route>
                    <Route path="/welcome/:username" element={<Welcome/>}></Route>
                    <Route path="*" element={<ErrorComponent/>}></Route>
                    <Route path="/todolist" element={<ToDoListComponent/>}></Route>
                </Routes>
            </BrowserRouter>
            <FooterComponent/>
            
        </div>
    )
}

function LogIn()
{
    const [username, setusername] = useState('Nanda')
    const [password, setPassword] = useState('')
    const [showSuccess, setShowSuccess] = useState(false)
    const [showFailure, setShowFsilure] = useState(false)
    const navigate = useNavigate()
    function handleUsernameChange(event)
    {
        setusername(event.target.value)
    }

    function handlePasswordChange(event)
    {
        setPassword(event.target.value)
    }

    function LogInValidation()
    {
        if(username==='Nanda' && password==='WASDskal')
        {
            setShowSuccess(true)
            setShowFsilure(false)
            navigate(`/welcome/${username}`)
        }
        else
        {
            setShowSuccess(false)
            setShowFsilure(true)
        }
    }
    return(
        <div className="LogIn">
            <div className="LogInform">
                <h1>LogIn Here</h1>
                <div>
                    {showSuccess && <div>LogIn Successfull</div>}
                    {showFailure && <div>LogIn Failed try again</div>}
                    <label>UserName</label>
                    <input type="text" name="username" value={username} onChange={handleUsernameChange}/>
                </div>
                <div>
                    <label>Password</label>
                    <input type="password" name="passeord" value={password} onChange={handlePasswordChange}/>
                </div>
                <button name="LogIn" onClick={LogInValidation}>LogIn</button>
            </div>
        </div>
    )
}

function Welcome()
{
    const param = useParams()
    return(
        <div className="welcomeComponent">
            <h1>Welcome {param.username}</h1>
            <div>
                <h3>How are you Today</h3>
                Manage Your ToDos- <Link to="/todolist">click here </Link>
            </div>
        </div>
    )
}

function ErrorComponent()
{
    return(
        <div className="errorComponent">
            <h1>We are working really hard</h1>
            <div>
                <h3>Apologies for 404. Reach out for our team XXXXXXX</h3>
            </div>
        </div>
    )
}

function ToDoListComponent()
{
    const today = new Date()
    const targetDate =  new Date(today.getFullYear()+12, today.getMonth(), today.getDay())
    const ToDos = [
                    {id : 1, description :"Learn Java", status:false, targetDate:targetDate},
                    {id : 1, description :"Learn React", status:false, targetDate:targetDate},
                    {id : 1, description :"Learn Spring", status:false, targetDate:targetDate},
                    {id : 1, description :"Learn AWS", status:false, targetDate:targetDate},
                    {id : 1, description :"Learn SQL", status:false, targetDate:targetDate}
                  ] 
    return(
        <div className="todoList">
            <h1>Things You need to do</h1>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Id</th>
                            <th>Description</th>
                            <th>Status</th>
                            <th>Target Date</th>
                            
                        </tr>
                    </thead>
                    <tbody>
                        {
                            ToDos.map(
                                todo=>
                                  <tr key={todo.id}>
                                    <td>{todo.id}</td>
                                    <td>{todo.description}</td>
                                    <td>{todo.status.toString()}</td>
                                    <td>{todo.targetDate.toDateString()}</td>
                                  </tr>
                            )
                        }
                    </tbody>
                </table>
            </div>
        </div>
    )
}

 function HeaderComponent()
 {
    return(
        <div>
            <h3>header</h3>
            <hr />
        </div>
    )
 }

 function FooterComponent()
 {
    return(
        <div>
            <hr />
            <h3>Footer</h3>
        </div>
    )
 }
